INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(9, 1, 'Marvel Spider Man', 'Ação', 'PS4', 'Seja melhor. Seja você mesmo. Acompanhe a trajetória de Miles Morales à medida que ele aprende a dominar poderes incríveis e explosivos para se tornar o novo Spider-Man. Na aventura mais recente do universo de Marvel\'s Spider-Man, o adolescente Miles Morales está se adaptando à sua nova casa enquanto segue os passos de seu mentor, Peter Parker, para se tornar um novo Spider-Man. Mas uma violenta disputa de forças ameaça destruir seu novo lar e faz o aspirante a herói perceber que com grandes poderes também vêm grandes responsabilidades. Para salvar a Nova York da Marvel, Miles precisa reconhecer e assumir o título de Spider-Man.', 'Insomniac', 'Insomniac Games', '1', 'Teen', '199.90', '146.99', '132.90', '131.91', 'spiderman.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(11, 2, 'FIFA 19', 'Esporte', 'PS3, PS4, Xbox One, Xbox 360, Switch, PC', 'Feito com Frostbit, EA SPORTS FIFA 19 entrega uma experiência campeã dentro e fora do campo. Do aspecto tático à cada toque técnico, controle o campo em cada momento com novos elementos de gameplay no EA SPORTS FIFA 19. O novíssimo Sistema Ativo de Toque permite controle mais próximo, táticas dinâmicas possibilitam configurações de equipe mais profundas e acessíveis, batalhas 50/50 permitem maior fisicalidade e mais habilidade do usuário nas disputas por bolas perdidas, finalizações cadenciadas elevam o controle do usuário atacando, e a evolução da Tecnologia Real Player Motion continua a melhorar as personalidades dos jogadores com animações autênticas e realistas.', 'EA Sports', 'EA Vancouver & EA Romania', '1-4', 'Livre', '89.91', '86.49', '86.49', '90.00', 'fifa19.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(12, 3, 'Resident Evil 2', 'Ação', 'PS4, Xbox One, PC', 'Resident Evil 2 o sucesso da Capcom, lançado para o PlayStation 1 e GameCube, chegou agora para PlayStation 4 e Xbox One, totalmente otimizados e melhorados para rodarem na resolução máxima de 1080p, Full HD. Tenha em sua casa um dos clássicos do gênero tiro/terror, com os gráficos e jogabilidade melhorados para deixar a sua experiência ainda melhor. Um vírus maligno toma conta dos residentes de Raccoon City em setembro de 1998, afundando a cidade no caos enquanto zumbis comedores de carne humana vagam pelas ruas em busca de sobreviventes. Agora você deve ajudar as pessoas que restaram a sobreviver à está catástrofe, e tentar eliminar o máximo de infectados possíveis. Está preparado para o retorno de Resident Evil 2?', 'Capcom', 'Capcom', '1', 'Mature', '109.90', '124.00', '123.02', '189.00', 're2.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(13, 4, 'Battlefield V', 'Ação', 'PS4, Xbox One, PC', 'Leve seu pelotão à vitória em experiências multiplayer totalmente novas, como o multimapa Operações Grandiosas. Lute ao redor do mundo na campanha de um jogador de Histórias de Guerra. Monte sua Companhia de soldados, armas e veículos personalizados e leve-os em uma jornada expansiva em Cursos da Guerra. Este é o Battlefield mais intenso, imersivo e inovador já feito. Você nunca será igual.', 'EA', 'DICE', '2-4', 'Mature', '115.75', '198.88', '150.00', '150.00', 'battlefield-v.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(14, 5, 'The Medium', 'Aventura', 'Xbox Series X, PC', 'Desvende um mistério sombrio que só uma médium pode resolver. Viaje até um resort abandonado e use suas habilidades psíquicas para revelar seus segredos perturbadores, resolver quebra-cabeças de dupla realidade, sobreviver a espíritos sinistros e explorar dois mundos ao mesmo tempo.', 'Bloober Team SA', 'Bloober Team', '1', 'Mature', '99.00', '184.95', '99.00', '187.90', 'themedium.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(15, 6, 'Final Fantasy XV', 'RPG', 'PS4, Xbox One, PC', 'Prepare-se para estar no centro da aventura de fantasia definitiva. Entre no mundo de Final Fantasy XV e participe de batalhas épicas e cheias de ação em sua jornada. Você é Noctis, o Príncipe do Reino de Lucis, e sua missão é resgatar sua terra natal das mãos do exército imperial. Junto de seus maiores amigos, você irá assumir o volante e viver uma viagem como nenhuma outra, através do mundo encontrando criaturas gigantescas e inimigos impiedosos.', 'Square Enix', 'Square Enix', '1', 'Teen', '149.99', '106.81', '112.74', '159.99', 'ff-xv.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(16, 7, 'Cyberpunk 2077', 'RPG', 'PS4, PS5, Xbox One, Xbox Series X, PC', 'Cyberpunk 2077 é uma história de ação e aventura de mundo aberto ambientada em Night City, uma megalópole obcecada por poder, glamour e biomodificações. Você joga como V, um mercenário fora da lei atrás de um implante único que carrega a chave da imortalidade. Você pode personalizar aparatos cibernéticos, conjunto de habilidades e estilo de jogo do personagem e explorar uma vasta cidade onde as decisões tomadas definem a história e o mundo ao seu redor.\r\n\r\n', 'Cd Projekt Red', 'Cd Projekt Red', '1', 'Adults', '49.84', '59.90', '59.90', '59.90', 'cyberpunk2077.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(17, 8, 'DOOM Eternal', 'Ação', 'PS4, PS5, Xbox One, Xbox Series X, Switch, PC', 'Os exércitos do Inferno invadiram a Terra. Torne-se o Slayer em uma campanha épica para um jogador e derrote demônios entre dimensões para impedir a derradeira destruição da humanidade.\r\n\r\nA única coisa que eles temem... é você.\r\n\r\nViva a combinação suprema de velocidade e poder em DOOM Eternal - o próximo avanço de combate acelerado em primeira pessoa.\r\n\r\nDescubra as origens do Slayer e sua eterna missão de DESTRUIR O INFERNO.', 'Bethesda Softworks', 'id Software', '2-3', 'Adults', '51.99', '47.00', '48.82', '49.39', 'doometernal.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(20, 9, 'Red Dead Redemption 2', 'Ação', 'PS4, Xbox One, PC', 'Entre no mundo vibrante e em constante desenvolvimento do Red Dead Online e experimente a vida na fronteira dos EUA.\r\n\r\nTrilhe seu próprio caminho enquanto enfrenta autoridades, gangues fora da lei e animais selvagens ferozes para construir uma vida na fronteira dos Estados Unidos. Monte um acampamento, cavalgue com ou sem um bando e explore tudo, das montanhas nevadas no norte aos pântanos do sul, de postos remotos a fazendas agitadas e cidades vibrantes. Vá atrás de recompensas, cace, pesque e negocie, procure tesouros exóticos, toque sua própria destilaria clandestina de Moonshine ou se torne Naturalista para aprender os segredos do reino animal e muito mais num mundo rico em detalhes.\r\n\r\nJunte-se a milhões de outros jogadores no Oeste dos EUA e experiencie um mundo repleto de novos recursos, modos de jogo e melhorias adicionais.\r\n', 'Rockstar Games', 'Rockstar Studios', '2-32', 'Adults', '168.32', '159.70', '159.70', '150.86', 'rdr2.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(21, 10, 'God of War', 'Ação', 'PS4', 'É um novo começo para Kratos. Vivendo como um homem longe da sombra dos deuses, ele se aventura pelas selvagens florestas nórdicas com seu filho Atreus, lutando para cumprir uma missão profundamente pessoal. O Santa Monica Studio e o diretor de criação Cory Barlog lançam um novo começo para um dos personagens mais conhecidos dos jogos. Vivendo como um homem, fora da sombra dos deuses, Kratos deve se adaptar a terras desconhecidas, ameaças inesperadas e a uma segunda oportunidade de ser pai. Junto ao seu filho, Atreus, os dois vão se aventurar pelas selvagens florestas nórdicas e lutar para cumprir uma missão profundamente pessoal.', 'Sony', 'Santa Monica Studio', '1', 'Adults', '76.59', '77.99', '83.49', '79.90', 'gow.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(22, 11, 'Mortal Kombat 11', 'Ação', 'PS4, PS5, Xbox One, Xbox Series X, Switch, PC', 'Mortal Kombat está de volta e melhor do que nunca na nova evolução dessa franquia icônica. As novas Variações Customizadas de Personagem oferecem controle sem precedentes para personalizar os lutadores e torná-los seus. O novo motor gráfico demonstra em detalhes cada momento, dos ossos triturados aos olhos saltando, te trazendo tão perto da luta que você consegue senti-la. Trazendo um elenco de personagens novos e Klássicos, o aclamado modo história de Mortal Kombat está de volta, continuando a saga épica que vem sendo construída ao longo de 25 anos.', 'Warner Games', 'NetherRealm Studios', '2', 'Adults', '149.90', '139.99', '123.49', '159.90', 'mk11.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(23, 12, 'Assassin\'s Creed: Odyssey', 'RPG', 'PS4, Xbox One, Switch, PC', 'Escreva sua odisseia e viva aventuras incríveis em um mundo onde cada escolha importa. Rejeitado por sua família, você embarca em uma jornada épica, indo de jovem pária a herói lendário de Esparta, para descobrir a verdade sobre seu passado. Trilhe seu caminho em uma Grécia despedaçada pela guerra e moldada por deuses e homens, onde as montanhas e o oceano se chocam.', 'Ubisoft', 'Ubisoft', '1', 'Adults', '170.99', '218.49', '218.49', '179.99', 'aco.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(24, 13, 'Resident Evil 3', 'Ação', 'PS4, Xbox One, PC', 'Presencie os eventos que ocorreram em Raccoon City em um Resident Evil 3 totalmente reimaginado, que também incluirá o Resident Evil Resistance, uma experiência multijogador online assimétrica de 4 contra 1 em seu lançamento em 3 de abril de 2020 para PlayStation®4, Xbox One, e Xbox One X Os acontecimentos angustiantes de Jill Valentine, um membro do S.T.A.R.S. em Resident Evil 3 se passam nas terríveis horas que precedem os eventos de Resident Evil 2, dando uma nova perspectiva ao sofrimento dos moradores de Raccoon City. Qualquer esperança de escapar é frustrada por outra estrela da franquia Resident Evil: a imponente Arma Bio-Orgânica, Nemesis. Essa brutal e inteligente monstruosidade usa um arsenal bélico de extremo poder para eliminar impiedosamente qualquer membro sobrevivente do S.T.A.R.S. na cidade, sendo Jill seu último alvo.', 'Capcom ', 'Capcom ', '1', 'Mature', '169.89', '169.90', '179.89', '164.89', 're3.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(25, 14, 'Ghost of Tsushima', 'Ação', 'PS4', 'No final do século XIII, o Império Mongol destruiu nações inteiras em sua campanha para conquistar o Oriente. A ilha de Tsushima é tudo o que resta entre o Japão e uma enorme invasão mongol liderada por um general ardiloso e implacável, Khotun Khan. Em meio à ilha devastada pela primeira onda de ataques mongóis está Jin Sakai, guerreiro samurai e um dos últimos sobreviventes de seu clã. Ele está decidido a fazer o que for preciso, custe o que custar, para proteger seu povo e recuperar seu lar. Jin deve deixar de lado as tradições que o moldaram como guerreiro e forjar um novo caminho, o do Fantasma, travando uma guerra atípica pela liberdade de Tsushima. Aventure-se além dos campos de batalha e vivencie o Japão feudal de uma forma nunca antes vista. Neste jogo de ação e aventura em mundo aberto, trilhe por paisagens vastas e terrenos amplos, encontrando personagens riquíssimos, descobrindo monumentos antigos e revelando toda a beleza oculta de Tsushima. Explore regiões meticulosamente criadas que mostram toda a diversidade dessa enorme ilha. De campos ondulantes e santuários tranquilos a florestas ancestrais, vilas e montanhas com paisagens de brilhar os olhos. Encontre paz na quietude serena da natureza e alívio nos momentos partilhados com as pessoas que ajuda ao longo de sua jornada.', 'Sony', 'Sucker Punch', '1', 'Mature', '263.05', '226.21', '214.90', '237.40', 'ghost.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(26, 15, 'Hitman 3', 'Ação', 'PS4, PS5, Xbox One, Xbox Series X, Switch, PC', 'Torne-se o icônico assassino Agente 47 mais uma vez nesta conclusão dramática da trilogia Mundo de Assassinato. O Agente 47 retorna como profissional implacável em Hitman 3 para cumprir os contratos mais importantes de sua carreira. Quando a poeira baixar, 47 e o mundo em que vive jamais serão os mesmos. Visite lugares exóticos, meticulosamente detalhados e cheios de oportunidades criativas: um mundo tátil e imersivo e oferece escolhas sem iguais para o jogador, além de diferentes formas de repetir as missões. \r\nTodos os lugares de Hitman e Hitman 2 podem ser importados para Hitman 3, permitindo que você jogue todos os títulos da trilogia Mundo de Assassinato. Seu progresso do Hitman 2 também é carregado diretamente para o Hitman 3 no lançamento.', 'Io-Interactive', 'Io-Interactive', '1', 'Mature', '279.89', '210.42', '199.90', '189.37', 'hitman-iii.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(27, 16, 'Far Cry 5', 'Ação', 'PS4, PS5, Xbox One, Stadia, PC', 'Far Cry chega aos Estados Unidos da América no jogo mais recente da franquia premiada. Hope County, Montana, foi tomada por um culto apocalíptico fanático – O Projeto em Eden’s Gate. Com sua chegada, você deve acender o fogo da resistência para libertar a comunidade. Atice as chamas da resistência e lute para livrar Hope County das mãos de um culto mortal. Cuidado com a ira de Joseph Seed e os seguidores do seu culto enquanto você ajuda a resistência no interior dos EUA. Explore Hope County e descubra o interior de Montana, sua vida selvagem e seus habitantes nesse mundo aberto emocionante. Atualize para a Gold Edition e obtenha acesso imediato a todo o conteúdo adicional da Deluxe Edition, mais o Passe de Temporada. Suporte ao PlayStation 4 Pro (agora com resolução 4K).', 'Ubisoft', 'Ubisoft', '1', 'Mature', '94.63', '89.90', '84.99', '75.34', 'farcry-5.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(28, 17, 'Rocket League', 'Corrida', 'PS4, Xbox One, Switch, PC, Macintosh', 'Baixe e compita nesse híbrido radical de futebol estilo arcade e destruição automotiva! Personalize seu carro, entre em campo e compita em um dos jogos esportivos mais aclamados pela crítica de todos os tempos! Baixe e prepare o seu chute!\r\nEntre em campo sozinho ou com amigos nos modos online 1x1, 2x2 e 3x3, ou aproveite os modos extras como Rumble, Snow Day ou Hoops. Desbloqueie itens no Rocket Pass, suba nos rankings competitivos, participe de torneios competitivos, conclua desafios, aproveite a progressão multiplataforma e muito mais! O campo aguarda por você. Prepare o seu chute!', 'Psyonix', 'Psyonix', '1-8', 'Everyone', '182.52', '202.80', '204.80', '196.92', 'rocket-league.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(29, 18, 'Death Stranding', 'Ação', 'PS4, PC', 'Do lendário criador de jogos Hideo Kojima, surge uma experiência totalmente inédita que desafia o gênero. Sam Bridges precisa enfrentar um mundo profundamente transformado pelo Death Stranding. Carregando os restos desconectados do nosso futuro em suas mãos, ele embarca em uma jornada para reconectar o mundo destruído.', 'Sony ', 'Kojima Productions', '1', 'Mature', '48.49', '77.90', '94.91', '64.10', 'death-stranding.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(30, 19, 'Bloodborne', 'RPG', 'PS4', 'Enfrente seus pesadelos enquanto busca respostas na antiga cidade de Yharnam, agora amaldiçoada com uma estranha doença endêmica que se espalha pelas ruas como fogo. Perigo, morte e loucura estão em cada canto deste sombrio e horroroso mundo, e você deve descobrir seus segredos mais sombrios para sobreviver.\r\n\r\n-Um aterrorizante mundo novo: Faça uma jornada para uma cidade gótica cheia de horror, onde multidões loucas e criaturas assustadoras espreitam em cada canto.\r\n-Combate estratégico de ação: Armado com um arsenal exclusivo de armamentos, incluindo armas e cutelos, você vai precisar de sagacidade, estratégia e reflexos para derrotar os ágeis e inteligentes inimigos que protegem os segredos obscuros da cidade.\r\n-Uma nova geração de RPG de ação: Ambientes góticos surpreendentemente detalhados, iluminação atmosférica e novas experiências online avançadas mostram o poder e a proeza do sistema PlayStation(R)4.\r\n-Calabouços de cálices que mudam o tempo todo para explorar: Use cálices sagrados para obter acesso a uma rede de vastas ruínas subterrâneas, cheias de armadilhas, feras e recompensas, para explorar e conquistar sozinho ou com outros. Esses calabouços gerados proceduralmente oferecem novos desafios para dominar, e podem ser carregados ou compartilhados com amigos.', 'Sony ', 'FromSoftware', '1', 'Mature', '59.90', '59.90', '65.90', '30.30', 'bloodborne.jpg', );
INSERT INTO `vitrine` (`id_vitrine`, `cd_prod`, `nome`, `categoria`, `plataformas`, `descricao`, `marca`, `developer`, `jogadores`, `classificacao`, `kabum`, `submarino`, `americanas`, `magalu`, `NomeImg`, `Imagem`) VALUES
(31, 20, 'Uncharted 4: A Thief\'s End', 'Ação', 'PS4', 'Vários anos após sua última aventura, o aposentado caçador de tesouros, Nathan Drake, é forçado a voltar para o mundo dos ladrões. Com riscos muito mais pessoais, Drake embarca em uma jornada pelo mundo em busca de uma conspiração histórica por trás de um famoso tesouro pirata. Sua maior aventura testará seus limites físicos, sua determinação e, finalmente, o que ele está disposto a sacrificar para salvar quem ama.\r\n', 'Sony ', 'Naughty Dog', '1', 'Teen', '59.90', '53.91', '59.90', '56.90', 'uncharted-4.jpg', );

